void setup() {
  // put your setup code here, to run once:
  Serial.begin(115200);
  temp1 = 0;
  temp2 = 0;
  analogSetWidth(12);
  analogSetAttenuation(ADC_11db);

  SerialPort_2.begin(115200, SERIAL_8N1, 16, 17);
  delay(1000);
}

void loop() {

  if (SerialPort_2.available()){
    //SerialPort_2.readBytes(PWMread, 2);
    //previous_PWM1 = PWM_Value_1;
    //previous_PWM2 = PWM_Value_2;
    PWM_readings = SerialPort_2.readString();
    String value1 = PWM_readings.substring(0, PWM_readings.indexOf(','));
    String value2 = PWM_readings.substring(PWM_readings.indexOf(',') + 1);
    PWM_Value_1 = value1.toDouble();
    PWM_Value_2 = value2.toDouble();
  }

  //if (PWM_Value_1 > previous_PWM1):
    

  SETPWM();

  readTemperature();
  temp1 = (temp1/4095)*3.3 + 0.101;
  temp1 = (temp1 - 0.5)/0.01;
  temp2 = (temp2/4095)*3.3 + 0.101;
  temp2 = (temp2 - 0.5)/0.01;

  //compensation();


  //String data= String(temp1)+","+String(temp2)+","+String(PWM_Value_1)+","+String(PWM_Value_2);
  String data2= String(PWM_Value_2)+","+String(PWM_Value_1)+","+String(temp2)+","+String(temp1);
  Serial.println(data2);
  delay(100);

}

void SETPWM(){
  analogWrite(PWM_Channel1, PWM_Value_1);
  analogWrite(PWM_Channel2, PWM_Value_2);
}


void readTemperature(){
  int Raw_1 = 0;
  int Raw_2 = 0;
  for (int n = 0; n < 30; n++)
  {
    Raw_1 += analogRead(t_1);
    int Raw_1 = (int)ADC_LUT[Raw_1];
    Raw_2 += analogRead(t_2);
    int Raw_2 = (int)ADC_LUT[Raw_2];
    //delay(2);
  }

  temp1 = Raw_1 / 30;
  temp2 = Raw_2 / 30;

}
